import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View ,ImageBackground, Button, Alert, Modal } from 'react-native';


const image={uri:"https://reactjs.org/logo-og.png"};
export default function App() {

  // const imagesrc2={"Aquaman.jpg"};
  return (
    <View style={[styles.container, {flexDirection: "column"}]}>
    {/* <ImageBackground source={require('./Aquaman.jpg')} resizeMode="cover" style={styles.image}> */}
    <ImageBackground source={image} resizeMode="cover" style={styles.image}>
      <View style={styles.container}>
        <StatusBar 
          animated={true}
          backgroundColor="#61dafb"></StatusBar>

          <Text style={styles.text}>Open up App.js to start working on your app!</Text>
          <View >
            <Button title="hello" onPress={() => Alert.alert('Button pressed')} style={outerHeight=50}></Button>
          </View>
        <Modal style={styles.modal}>
            <Text>Yo Yo Bitches!</Text> 
          </Modal>
      </View>
      <View style={[styles.lowerContainor,{flexDirection: "coloum"}]}>
        <Button style={styles.text}>hello</Button>
        <Button style={styles.text}>bollo</Button>
        <Button style={styles.text}>bollo</Button>
        <Button style={styles.text}>bollo</Button>
        <Button style={styles.text}>bollo</Button>
        <Button style={styles.text}>bollo</Button>
      </View>
      </ImageBackground>
      </View>
  );
}

const styles = StyleSheet.create({
  basecontainer:{
    flex: 10,
    backgroundColor: 'skyblue',
    alignItems: 'center',
    justifyContent: 'center',
  },
  container: {
    flex:1,
    alignItems: 'center',
    // justifyContent: "space-around",
  },
  lowerContainor:{
    flex:1.1,
    alignSelf:"stretch",
    justifyContent: "space-around",

    // justifyContent:"center"
  },
  image: {
    flex: 1,
    color:"#f0f",
    alignSelf:"stretch",
    justifyContent: "center"
  },
  button:{
    alignSelf:"center",
    fontSize:40,
    height:50,
    width:50,
  },
  button2:{
    flex:1,
    backgroundColor:"#dc143c",
    height:"10%",
    width:"20%",
    alignSelf:"auto",
  },
  text:{
    // color: "white",
    flex:1,
    color: "#61dafb",
    fontSize: 42,
    lineHeight: 84,
    fontWeight: "bold",
    textAlign: "center",
    backgroundColor: "#000000c0"
  },
  modal:{
    color:"White",
    backgroundColor:"White",
    justifyContent:'center',
    alignSelf:"center",
  },
});
